import "../css/itemlist.css"

const ItemContents = () => {
  return (
    <>
      <div className="wrap it_contents">
        <div className="container">
          <div className="img-box">
            <img src={require("../../Main/img/test_1.jpg")} alt="이미지 이름"/>
          </div>
          <div className="info-box"></div>
        </div>
      </div>
    </>
  );
}
 
export default ItemContents;
